import { Link } from "react-router-dom";
import classes from "./subheader.module.css";
import Button from "../UI/Button/Button";

function SubHeaderPage() {
  return (
    <ul className={classes.subheader_list_container}>
      {/* <li>
        <Link to="">Job Preview</Link>
      </li>
      <li>
        <Link to="">Applicants</Link>
      </li>
      <li>
        <Link to="">Match</Link>
      </li>
      <li>
        <Link to="">Messages</Link>
      </li> */}
      <li className={`${classes.subheader_list} ${classes.active_link}`}>
        <Button theme="text">Job Preview</Button>
      </li>
      <li className={classes.subheader_list}>
        <Button theme="text">Applications</Button>
      </li>
      <li className={classes.subheader_list}>
        <Button theme="text">Match</Button>
      </li>
      <li className={classes.subheader_list}>Messages</li>
    </ul>
  );
}

export default SubHeaderPage;
